import './App.css';
import axios from 'axios';
import { Button, Container, Card, Row } from 'react-bootstrap'


ReactDOM.render(
  <React.StrictMode>
  <BrowserRouter>       
    <App />
  </BrowserRouter>
  </React.StrictMode>,
document.getElementById('root')
